	local f1_local2 = math.floor( (Engine.DEIDGHDBHD() - CP.CheckpointResetStartUTC) / CP.CheckpointResetPeriodUTC )
	if f1_local1 < f1_local2 then
		local f1_local3 = PlayerData.BFFBGAJGD( f1_arg1, CoD.StatsGroup.Coop )
		f1_local3.checkpointReached.cp_raid_complex:set( 0 )
		f1_local3 = PlayerData.BFFBGAJGD( f1_arg1, CoD.StatsGroup.Coop )
		f1_local3.checkpointReached.cp_dntsk_raid:set( 0 )
		f1_local3 = PlayerData.BFFBGAJGD( f1_arg1, CoD.StatsGroup.Coop )
		f1_local3.checkpointReached.week:set( f1_local2 )
		f1_local1 = f1_local2
	end
end

